import axios from "axios";

const Page = ({ stars }) => <div>Next stars: {stars.from}</div>;

Page.getInitialProps = async ({ req }) => {
  return req
    ? { from: "server" } // 서버에서 실행 할 시
    : { from: "client " }; // 클라이언트에서 실행 할 시
};

export default Page;
